import { useSelector } from "react-redux"


export const SearchFilter = (event) => {
    const searchdata = useSelector((state) => state.array2)
    return (dispatch) => {
        const ValueStore = []
        for (let i = 1; i >= searchdata.length; i++)
            // for (let n in i) {
            if (searchdata[i]) {
                ValueStore.push(searchdata[i])
                console.log(ValueStore)
                // }
            }
        dispatch({
            type: 'searchfilter',
            payload: ValueStore
        })
    }
}
